css:
.php-debug {
  overflow-y: scroll;
}
.php-debug .php-debug-tab {
  flex: 1;
  overflow-y: scroll;
}
.php-debug .breakpoint-line {
  padding-left: 5px;
}
.php-debug li {
  list-style-type: none;
}
.php-debug ul {
  padding-left: 15px;
}
.php-debug .php-debug-watchpoints .type,
.php-debug .context-variable-list-view .type {
  padding-left: 1em;
}
.breakpoint-settings-view .setting-container atom-text-editor[mini] {
  width: 100%;
}
.breakpoint-settings-view .setting-container .setting-action {
  padding-left: .5em;
  line-height: 2em;
}
atom-panel.modal .breakpoint-settings-view .setting-new atom-text-editor[mini] {
  margin-bottom: .15em;
}
.breakpoint-settings-view .setting-container {
  display: flex;
  align-items: stretch;
}
.breakpoint-settings-view .close-icon,
.php-debug-watchpoints .close-icon {
  position: absolute;
  top: 1px;
  right: 10px;
  cursor: default;
  top: -1.2em;
  right: 0;
  z-index: 2;
  padding: 0 0.8em;
  height: 3em;
  line-height: 3em;
  text-align: center;
  transform: scale(1);
  transition: transform .08s;
}
.breakpoint-settings-view .close-icon:hover {
  transform: scale(1.5);
  transition: transform .08s;
}
.breakpoint-settings-view .close-icon:before,
.php-debug-watchpoints .close-icon:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f081";
}
.php-debug-watchpoints .close-icon {
  top: 0em;
  right: 0;
  height: 1em;
  line-height: 1em;
}
.php-debug-watchpoints .close-icon:hover {
  transform: scale(1.1);
  transition: transform .08s;
}
.tabs-view {
  display: flex;
  height: 100%;
}
.tabs-view:nth-child(1) {
  order: 0;
}
.tabs-view:nth-child(2) {
  order: 1;
}
.tabs-view:nth-child(3) {
  order: 2;
}
.tabs-view:nth-child(3) {
  order: 3;
}
.php-debug-watchpoints .watch-item {
  position: relative;
}
